// Routing.js-module

import React from "react"

// component_nesting_into_routings
import Home from './MainMenu/Home'
 

//router_package
import { BrowserRouter } from 'react-router-dom';

//Create Home Component
function Routings()
{
  
  return  (<BrowserRouter>
       
        <Home />
  
  </BrowserRouter>)
  
}

export default Routings;
